import React from "react";
import image from "../image/consult.jpg"

export default function Cards() {
	return (
		<div clasName="homepage" align="center">
		<h1>Our Services</h1>
		<div className="box" style={{ backgroundImage: "url("+ image +")" }}>
		<h2>Hello</h2>
		</div>
		</div>
		);
	}
